import React, { Component } from "react";
import Counter from "./Counter";
import { Card, Button, Row, Col, Container } from "react-bootstrap";
import img from "../../src/Krish.png";

class Counters extends Component {
  render() {
    let cardRender = this.props.counters.map((counter) => (
      <Card
        style={{ width: "18rem" }}
        // style={{ width: "18rem", display: "flex", flexDirection: "row" }}
        key={counter.id}
      >
        <Card.Img variant="top" style={{ height: 250, width: 250 }} src={img} />
        <Card.Body style={{ flex: 1 }}>
          <Card.Title>Card Title</Card.Title>
          <Card.Text>
            Some quick example text to build on the card title and make up the
            bulk of the card's content.
          </Card.Text>
          <Button variant="primary">Go somewhere</Button>
        </Card.Body>
      </Card>
      // <Row key={counter.id}>
      //   <Col sm="6">
      //     <Counter
      //       onIncrement={this.props.onIncrement}
      //       onDecrement={this.props.onDecrement}
      //       counter={counter}
      //     />
      //   </Col>
      // </Row>
    ));
    return <Container>{cardRender}</Container>;
  }
}

export default Counters;
